/** Container template to house monster creation form. */
@Component({
  selector: 'greg-enter-monster',
  templateUrl: './enter-monster.component.html',
  styleUrls: ['./enter-monster.component.scss'],
})
export class EnterMonsterComponent {
  /** EnterMonsterComponent Constructor */
  constructor() {}
}
<greg-page-template>
  <first-content>
    <greg-monster-form></greg-monster-form>
  </first-content>
  <second-content>
    <greg-monster-display></greg-monster-display>
  </second-content>
</greg-page-template>
